import React from 'react';
import './index.css';

function App() {
  return (
    <div>
      <header className="navbar">
        <h1>PetShop</h1>
      </header>

      <div className="container">
        <h5>Welcome to our PetShop!</h5>
        <button className="button-shop-now">Shop Now</button>
      </div>

      <footer>
        <p>&copy; 2025 PetShop. Todos os direitos reservados.</p>
        <a href="#">Contact Us</a>
      </footer>
    </div>
  );
}

export default App;
